import React from 'react'
import { useLocation } from 'react-router';
import './Error.css';

const Error = () => {
    const message = useLocation().state.message[0];
    
console.log(message);
    return (
        <div className="error">
            <h1> The Page is not available</h1>
         {
             message == undefined ?
             "" : <p> <strong>Error: {message} </strong></p>
         }
        </div>
    )
}

export default Error
